// Project page
// Dynamically pick page from projectPages

import React, { Component, Fragment } from 'react';
import {DatatonismPage, SpirPage, SteammindPage, SfbsPage} from './projects/export-projects';
import '../styles/projtemplate.css';

const projectPages = {
    1: DatatonismPage,
    2: SpirPage,
    3: SteammindPage,
    4: SfbsPage,
};

export default class Project extends Component {
    render () {
        const { projectList, match } = this.props
        const Page = projectPages[match.params.id]
        console.log(Page)
        return (
            <Fragment>
                <div class="container-grey no-flex">
                    <h1>{projectList[match.params.id].title}</h1>
                    <Page />
                </div>
            </Fragment>
        );
    };
};
